import {IoMenuSharp} from "react-icons/io5";
import "./Navbar.css";
import {Menu} from "./Menu";

export const Navbar=()=>{
    return(
        <div>
            <div className="nav-container">
                {/* <nav className="bg-gray-100 grid grid-cols-3 p-1.5 max-h-16"> */}
                <nav className="nav-class">
                    <div className="nav-start">
                    {/* <div  */}
                        <ul className="nav-start-items">
                            <li className="text-center font-bold text-4xl p-0.5 cursor-pointer hover:text-gray-500">Brand</li>
                            <li className="md:block text-center place-self-center cursor-pointer hidden font-semibold">About</li>
                        </ul>
                    </div>
                    {/* <div className="col-start-3 col-end-4 w-48 ml-auto place-self-center"> */}
                    <div className="nav-end">    
                        <ul className=" grid grid-cols-2 ">
                            <li className="md:block text-center place-self-center cursor-pointer hidden text-xl">Login</li>
                            <li className="md:block text-center place-self-center cursor-pointer hidden" >Register</li>
                            <li className="md:hidden ml-auto place-self-end"><Menu/></li>
                        </ul>
                    </div>
                </nav>
            </div>
        </div>
    )
}
